import React, { useEffect, useState } from "react";

function ClientImgOut() {
  const [imageURL, setImageURL] = useState("");

  useEffect(() => {
    const getImage = async () => {
      try {
        const response = await fetch(
          "http://your-django-server-url/upload_image_postback/",
          {
            method: "POST",
            body: JSON.stringify({ image_file_name: "path/to/your/image.jpg" }),
            headers: {
              "Content-Type": "application/json",
            },
          }
        );

        if (response.ok) {
          setImageURL(URL.createObjectURL(await response.blob()));
        } else {
          console.error("Error retrieving image:", response.status);
        }
      } catch (error) {
        console.error("Error retrieving image:", error);
      }
    };

    getImage();
  }, []);

  return (
    <div>
      <h2>Image here</h2>
      {imageURL && <img src={imageURL} alt="Server Image" />}
    </div>
  );
}

export default ClientImgOut;
